import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-63c39e1326f82",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/rzr/Desktop/学习/vuepress/docs/README.md").then(comp => {
        Vue.component("v-63c39e1326f82", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-38c0b5dfaa5df",
    path: "/accumulate/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/rzr/Desktop/学习/vuepress/docs/accumulate/README.md").then(comp => {
        Vue.component("v-38c0b5dfaa5df", comp.default)
        next()
      })
    }
  },
  {
    path: "/accumulate/index.html",
    redirect: "/accumulate/"
  },
  {
    name: "v-e9eb8db758f5f",
    path: "/algorithm/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/rzr/Desktop/学习/vuepress/docs/algorithm/README.md").then(comp => {
        Vue.component("v-e9eb8db758f5f", comp.default)
        next()
      })
    }
  },
  {
    path: "/algorithm/index.html",
    redirect: "/algorithm/"
  },
  {
    name: "v-da854864b48c8",
    path: "/guide.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/rzr/Desktop/学习/vuepress/docs/guide.md").then(comp => {
        Vue.component("v-da854864b48c8", comp.default)
        next()
      })
    }
  },
  {
    name: "v-890f1955b3d9a",
    path: "/others/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/rzr/Desktop/学习/vuepress/docs/others/README.md").then(comp => {
        Vue.component("v-890f1955b3d9a", comp.default)
